import React, { lazy } from 'react';
import { Redirect } from 'react-router-dom';
import Home from './pages/Home/Home'


const routes = [
  {
    path: '/',
    exact: true,
    component: () => <Home />
  },
  {
    path: '/account/login',
    exact: true,
    component: () => <div>Hello Louji</div>
  },
];

export default routes;
